import axios from "axios";

const apiKey = "17924110-c02f67d32060055f35546bb91";
const fetchPics = (query) => {
  return axios
    .get(
      `https://pixabay.com/api/?key=${apiKey}&per_page=12&q=yellow+flowers&image_type=photo`
    )
    .then((response) => response.data.hits, console.log(response.data.hits));
};
export default fetchPics;
